def sum_of_primes(start: int, end: int) -> int:
    prime_sum = 1
    for num in range(start, end + 1):
        if num < 2:
            continue
        is_prime = True
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            prime_sum += num
    return prime_sum

